import './Main.css';

const Main = () => {
  return (
  <div id="DivBody" class="bg-gray-100 text-gray-900">

    {/*navbar*/}
    <div class="fixed top-0 left-0 right-0 bg-white shadow-md z-50 grid grid-cols-3 items-center px-4">

      {/*burger*/}
      <div>
        put burger menu &
        put logo here
      </div>
      {/*burger*/}

      {/*search bar*/}
      <div id="searchbar" class="flex justify-center">
        <input 
          class="w-80"
          type="search"
          name="search"
          placeholder="Type To Search"
          value="{{ .Values.SearchTerm }}"
          hx-get="/search?newSearch=1"
          hx-trigger="input changed"
          hx-target="#products"
          hx-indicator=".htmx-indicator"
          hx-swap="innerHTML"/>
        <div class="htmx-indicator mt-5 absolute text-green-600 font-semibold ">Searching...</div>
      </div>
      {/*search bar*/}

      {/* clickable elements in a navbar  */}
      <div class="flex justify-end gap-10 px-2">

        <div class="relative">
          <button class="bg-blue-500 rounded-md" id="ProfileDropdown">
            <img 
              type="button" src="{{ .Values.ProfileImage }}" 
              alt="profile image" class="w-12 h-12 rounded-full object-cover"
              onerror="this.onerror=null;this.src='https://img.freepik.com/free-vector/blue-circle-with-white-user_78370-4707.jpg?t=st=1741218983~exp=1741222583~hmac=1b0ea872dd8d4b7b578200204a9df957dd072b79cd6b9644780d786ed6756b2b&w=740'"/>
          </button>
        </div>
        <div class="relative">
          <button class="bg-blue-500 rounded-md" id="CartDropdown">
            <img style="width: 50px;" src="https://www.pngmart.com/files/7/Cart-PNG-Transparent-Image.png"/>
          </button>
        </div>

      </div>
      {/* clickable elements in a navbar  */}

    </div>
    {/*navbar*/}
  </div>
  );
};

export default Main;
